const FormInput = ({ label, ...otherProps }) => (
  <div>
    <label htmlFor={domId}>{label}</label>
    <input {...otherProps} />
  </div>
);

FormInput.propTypes = {
  label: PropTypes.string.isRequired,
  otherProps: PropTypes.instanceOf(Object).isRequired,
};

export default FormInput;
